import card from "../assets/Card.svg";
import deck from "../assets/Deck.svg";
import React from "react";
export default function HomeLayout (){


return(

    <div className="mt-[62px] ml-[90px]">
    <div className="flex justify-between w-[1176px] h-[32px] g-[16px]" > 

    <div className="g-[8px ] w-[212px] h-[32px] m8-" >
        <button className="w-[112px] h-[32px] rounded-[4px]  bg-[#FFFFFF] text-[16px]" > <img className="w-[10.96px] h-[15px] top-[0.5px] left[2.5px] inline" src={card} alt="card icon" /> All Cards </button>


        <button className="" >
            <img className="inline w-[10.96px] h-[15px] top-[0.5px] left[2.5px] inline" src={deck} alt="Deck Icon"/>

            Decks</button>
    </div>
    <p>SW-API Deck Builder</p>
    <p>Keanu Howe</p>

    </div>
    <hr className="w-[1176px] h-[2px] border-2 border-[#B8B8B8] mt-[10px]"/>

    </div>


);



}
